import React from "react";
import styled from "styled-components";
import Page from "../../global/Page";
import BrandingAccents from "./BrandingAccents";
const Branding = () => {
    return (
        <Page>
            <BrandingAccents />

            <AGMTeam>
                <p className='heading'>AGM Team</p>
                <p className='description'>lorem50</p>
            </AGMTeam>
        </Page>
    );
};
const AGMTeam = styled.div`
    .heading {
        font-weight: 300;
        font-size: 24px;
        margin-bottom: 32px;
    }
    .description {
        font-weight: 300;
        font-size: 16px;
        line-height: 28px;
    }
`;
export default Branding;
